import React from "react";
import { Menu, Icon } from "antd";

const AppLayout = ({ children }) => {
return (
    <div>
        <Menu>
            <Menu.Item key="home">
                <Icon type="mail" />
                Navigation One
            </Menu.Item>
        </Menu>
        { children }
    </div>
)
}

export default AppLayout
